import React from 'react';
import Log from '../components/Log/index';

const Agence = () => {
    return (
     <div className="agence-page">
         <div className="log-container">
            <Log />
            <div className="img-container">
                <img src="../../public/img/log.svg" alt="Logo-VBS" />
            </div>
         </div>
     </div>
    );
};

export default Agence;
